import React from "react";
import CompanyLogo from "../img/CompanyLogo.jpeg";
import "./NavigationBar.css"

const NavigationBar = () => {
	return (
        <div className = "navBar">
            <div>
            <img src={CompanyLogo} alt="BV logo"/>
            </div>
        </div>
    )
};

export default NavigationBar;
